void DrawRadarScreen()
{
	ImColor color (g_Vars.color_red, g_Vars.color_green, g_Vars.color_blue, 1.f);
	int x, y;
	Vector origin;
	for (int i = 0; i < 33; i++) 
	{
		origin = g_LocalPlayer[i].ent->origin;

		if (g_LocalPlayer[i].Death)
			continue;
		if (!g_LocalPlayer[i].IsValidEnt)
			continue;
		if (g_LocalPlayer[i].ent->index == g_Local.ent->index)
			continue;
		if (!IsCanDraw(i, g_Vars.ESPTeamselection))
			continue;

		CalcRadarPoint(origin, x, y, false);
		auto angle = Vector();
		VectorAnglesRadar(Vector(ImGui::GetWindowSize().x / 2 - x, ImGui::GetWindowSize().y / 2 - y, 0.f), angle);

		const auto angle_yaw_rad = deg_2_rad(angle.y + 180.f);
		const auto new_point_x = ImGui::GetWindowSize().x / 2 +
			g_Vars.visual_radar_size / 2 * 8 * cosf(angle_yaw_rad);
		const auto new_point_y = ImGui::GetWindowSize().y / 2 +
			g_Vars.visual_radar_size / 2 * 8 * sinf(angle_yaw_rad);

		std::array<Vector2D, 3> points
		{
			Vector2D(new_point_x - (g_Vars.visual_radar_size / 4 + 3.5) / 2, new_point_y - (g_Vars.visual_radar_size / 4 + 3.5) / 2),
			Vector2D(new_point_x + (g_Vars.visual_radar_size / 4 + 3.5) / 4, new_point_y),
			Vector2D(new_point_x - (g_Vars.visual_radar_size / 4 + 3.5) / 2, new_point_y + (g_Vars.visual_radar_size / 4 + 3.5) / 2)
		};

		RotateTriangle(points, angle.y + 180.f);
		ImGui::GetCurrentWindow()->DrawList->AddTriangle(ImVec2(points.at(0).x, points.at(0).y), ImVec2(points.at(1).x, points.at(1).y), ImVec2(points.at(2).x, points.at(2).y), color);
	}
}
